      out.write("</style>\r\n");
      out.write("\r\n");
      out.write("<body>\r\n");
      out.write("<h4>QnA</h4>\r\n");
      out.write("<hr>\r\n");
      out.write("\r\n");
      out.write("<a class=\"btn\" href=\"#qna01\">코로나란?</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna02\">코로나의 증상/검사</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna03\">임신과 출산</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna04\">치료 및 예방</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna05\">접촉자 및 확진환자</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna06\">격리 및 격리해제</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna07\">백신 관련</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna08\">백신의 안전성과 이상반응</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna09\">코로나19 예방접종 관련 피해보상</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna10\">인과성 불충분한 중증 환자 의료비 지원사업</a>\r\n");
      out.write("<a class=\"btn\" href=\"#qna11\">기타</a>\r\n");
      out.write("<hr>\r\n");
      out.write("<!-- 윗부분은 목록을 만들고 a 태그로 각 번호의 목록으로 이동하게 만듬 -->\r\n");
      out.write("\r\n");
      out.write("<!-- 각 목록의 내용을 번호를 붙여서 작성 -->\r\n");
      out.write("<h5 id=\"qna01\">1. 코로나란?</h5>\r\n");
      out.write("<dl class=\"faq\">\r\n");
      out.write("  <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq1_desc\">\r\n");
      out.write("      코로나 바이러스 감염증-19는 어떤 질병인가요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq1_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 바이러스 감염증-19(코로나19)는 과거에 발견되지 않았던 새로운 코로나 바이러스인 SARS-CoV-2에 의해 발생하는\r\n");
      out.write("    	호흡기 감염병으로, 이 바이러스에 감염되면 무증상부터 중증에 이르기까지 다양한 임상증상이 나타날 수 있습니다.  <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 이 새로운 바이러스와 질병은 2019년 12월 중국 우한에서 처음 보고되었고, 현재 전 세계에 확산되었습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("   <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq2_desc\">\r\n");
      out.write("      코로나 바이러스는 어떤 바이러스인가요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq2_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 바이러스는 동물 및 사람에게 전파될 수 있는 바이러스로 그 중 사람에게 전파가능 함 사람 코로나 바이러스는 기존에\r\n");
      out.write("    	6종이 알려져 있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 이 중 4종은 감기와 같은 질병을 일으키는 바이러스이며, 나머지 2종은 각각 MERS-CoV와 SARS-CoV로 알려져있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 이번 유행의 원인 바이러스는 코로나바이러스(SARS-CoV-2)로 공개된 염기서열 분석을 통해 코로나 19 바이러스가 박쥐유래\r\n");
      out.write("    	사스 유사 바이러스와 89.1% 일치하는 것을 확인하였습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("     <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq3_desc\">\r\n");
      out.write("      코로나 19는 어떻게 전염되나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq3_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 19를 일으키는 바이러스는 사람에서 사람으로 전파되며 주로 환자와 직접 접촉 또는 호흡기를 통해 배출되는 비말에\r\n");
      out.write("    	의해 전염됩니다. 즉, 코로나 19에 감염된 사람이 말을 하거나 기침/재채기/노래 등을 할 떄 생성된 비말이 근처에 있는 사람들의\r\n");
      out.write("    	호흡기에 직접 닿거나, 비말이 묻은 손 또는 물건 등을 만진 뒤 눈/코/입을 만질 때 전염될 수 있습니다. <br>\r\n");
      out.write("		<br>\r\n");
      out.write("    	◎ 또한 공기 감염은 흔하지 않으나 의료기관의 에어로졸 생성 시술이나 밀폐된 공간에서 장시간 호흡기 비말을 만드는 환경 등\r\n");
      out.write("    	특수 상황에서 보통 비말이 도달하는 거리(2미터) 이상까지 바이러스 전파가 가능할 수 있습니다. \r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("  <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq4_desc\">\r\n");
      out.write("      코로나 19 환자의 대변이나 체액으로도 전염이 가능한가요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq4_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 환자의 대변에서 코로나19 바이러스가 검출되었다는 보고가 있었지만, 현재까지 환자의 대변으로 인해 코로나 19가 전염된\r\n");
      out.write("    	사레는 보고되지 않았습니다. 추가로 물이나 하수오물 같은 환경에서 바이러스가 생존할 수 있다는 증거도 발견되지 않았습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 혈액, 뇌척수액, 소변, 타액, 눈물 및 결막 분비물 등의 체액에서도 바이러스가 검출되었다는 보고가 있었지만, 그로 인해 \r\n");
      out.write("    	전염된 사례는 보고되지 않았습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("   <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq5_desc\">\r\n");
      out.write("      음식을 통해 코로나 19가 전염될 수 있나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq5_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 현재까지 코로나 19가 음식을 통해 전파된다는 증거는 없습니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 바이러스가 있는 음식의 포장 용기 표면이나 물체를 만진 후 자신의 입/코/눈을 만지면 코로나 19에 걸릴 수 있지만, \r\n");
      out.write("    	물체의 표면에서 이러한 코로나 바이러스의 생존력이 높지 않기 때문에 식품인 포장 용기를 통해 확산될 위험은 매우 낮습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 안전을 위해서는 항상 음식을 준비하거나 먹기 전에 비누와 물로 30초 동안 손을 씻는 것이 도움이 될 수 있습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd> \r\n");
      out.write("     <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq6_desc\">\r\n");
      out.write("      날씨가 따뜻해지면 코로나 19 전파를 막을 수 있나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq6_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 일반적으로 코로나 바이러스는 저온의 건조한 환경보다 고온 다습한 환경에서 생존 기간이 더 짧습니다. 하지만 코로나 19 바이러스에\r\n");
      out.write("    	대한 직접적인 온도와 관련된 자료와 바이러스 비활성화에 관련된 온도 정보는 아직까지 부족합니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 제한적이지만, 위도/온도/습도에 따른 코로나 19의 분포 양상이 계절성 호흡기 바이러스의 양상과 비슷하다는 연구 보고가 있었습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd> \r\n");
      out.write("       <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq7_desc\">\r\n");
      out.write("      카페 등의 다중이용 시설 및 가정에서 냉난방기 가동시, 환기는 얼마나 자주 해야 하나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq7_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나19는 비말, 접촉, 공기 전파를 통해 감염 가능하며, 주된 감염경로는 2미터 이내의 비말감염입니다. 공기감염은 흔하지 않지만, \r\n");
      out.write("    	밀폐된 공간에서 장시간 호흡기 비말을 배출하거나 환기가 부적절한 경우 발생 가능하여 집단감염을 일으킬 수 있으므로 실내 오염도를 \r\n");
      out.write("    	낮추기 위하여 충분한 환기를 실시하여야 합니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 환기 시에는 가급적 자연환기 하며, 창문을 개방하여 맞통풍하고, 공조장비 설치 시설은 외부공기 도입량을 가능한 높게 설정하여\r\n");
      out.write("    	최대한 외부 공기로 환기하며 가능하면 자연환기와 병행합니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd> \r\n");
      out.write(" </dl>\r\n");
      out.write("<p><a href=\"#top\">맨 위로 이동</a></p>\r\n");
      out.write("<hr>\r\n");
      out.write("\r\n");
      out.write("<h5 id=\"qna02\">2.코로나의 증상/검사</h5>\r\n");
      out.write(" <dl class=\"faq\">\r\n");
      out.write("  <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq8_desc\">\r\n");
      out.write("      코로나 19의 증상은 어떤것이 있나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq8_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 19의 가장 흔한 증상은 발열, 마른 기침, 피로이며 그 외에 후각 및 미각 소실, 근육통, 인후통, 콧물, 코막힘, 두통, 결막염,\r\n");
      out.write("    	설사, 피부 증상 등 다영한 증상이 나타날 수 있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 이러한 증상은 보통 경미하고 점진적으로 나타납니다. 사람에 따라 감염되어도 매우 약한 증상만 나타날 수 있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 대부분의 환자들(약 80%)은 특별한 치료없이 회복되나, 5명 중 1명 정도는 중증으로 진행 할 수 있습니다. 고령자나 고혈압, \r\n");
      out.write("    	심폐질환, 당뇨병이나 암과 같은 기저질환이 있는 사람들은 중증으로 진행 될 가능성이 높습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("   <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq9_desc\">\r\n");
      out.write("      무증상 환자도 다른 사람을 전염시킬 수 있나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq9_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 19의 주요 전파 방법은 코로나 19에 감염된 사람이 숨을 내쉬거나, 기침/재채기를 할 때 생성되는 호흡기 비말이 근처에\r\n");
      out.write("    	있는 사람들의 호흡기에 직접 닿거나, 비말이 묻은 손 또는 물건 등을 만진 뒤 눈/코/입을 만질 때 점막을 통해 전염되는 것입니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 코로나 19의 많은 환자들은 가벼운 증산만을 경험하지만, 증상이 가벼운 환자의 일부는 질환의 초기라서 증상이 약하게 나타나는\r\n");
      out.write("    	것일 수 있습니다. 경미한 기침 증상만 있거나, 증상을 잘 느끼지 못하는 사람의 경우에도 전염이 가능하다고 알려져 있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 무증상의 경우에도 전염이 가능하다는 연구가 있으나 아직까지 정확하게 알려지지 않아 추가 연구결과 발표시 공유할 예정입니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>\r\n");
      out.write("     <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq10_desc\">\r\n");
      out.write("      코로나 19에는 어떤 사람들이 더 위험한가요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq10_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 코로나 19는 아직까지 명확하게 알려지지 않았지만, 지금까지 연구될 결과에 의하면 65세 이상의 노인, 장기요양 시설 생활자,\r\n");
      out.write("    	기저질환(만성 폐질환, 천식, 심폐질환, 면역억제자, 비만, 당뇨병, 만성 신장 질환, 만성 간질환, 흡연자 등)을 가진 사람들에게 \r\n");
      out.write("    	더 위험할 수 있습니다.\r\n");
      out.write("    </p>\r\n");
      out.write("  </dd>  \r\n");
      out.write("       <dt>\r\n");
      out.write("    <button aria-expanded=\"false\" aria-controls=\"faq11_desc\">\r\n");
      out.write("      누가 검사 받을 수 있나요?\r\n");
      out.write("    </button>\r\n");
      out.write("  </dt>\r\n");
      out.write("  <dd>\r\n");
      out.write("    <p id=\"faq11_desc\" class=\"desc\">\r\n");
      out.write("    	◎ 본 지침 상의 사례 정의에 따라 의사환자 및 조사대상 유증상자로 분류되는 경우에는 확진검사를 받을 수 있습니다.<br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	◎ 중증응급환자(중증도 등급기준 1 및 2 등급) 또는 6시간 이상 지연할 수 없는 응급수술이 필요한 중증응급의심환자(중증도 등급기준 3등급)의\r\n");
      out.write("    	경우 응급 선별검사 또는 확진검사를 받을 수 있습니다. <br>\r\n");
      out.write("    	<br>\r\n");
      out.write("    	<table border=\"1\">\r\n");
      out.write("    		<tr><td>의사환자</td><td>확진환자와 접촉한 후 14일 이내에 코로나 19 임상증상이 나타난 자</td></tr>\r\n");
